import React from 'react';
import Data from '../data/products.json';




class Datalist extends React.Component {
  render(){
    return(<div>
        {Data.map((data) =>{ 
          return <div>
          <h3>{data.Title}</h3>
          <h4>{data.Description}</h4> 
          <p>{data.price}</p>
          </div>
          })}


        </div>
    )
  }


}

export default Datalist;
